import { useState } from "react";
import { useNavigate, useSearchParams } from "react-router-dom";

const Community_Create = () => {
  const navigate = useNavigate();
  return (
    <div>
      <div>여기는 커뮤니티 생성 페이지입니다.</div>
      <button
        onClick={() => {
          navigate(-1);
        }}
      >
        뒤로가기
      </button>
    </div>
  );
};

export default Community_Create;
